'''Bob shirts''' are a series of 5 differently coloured shirts depicting [[Bob the Jagex Cat]]. These shirts can be obtained from [[Clue scroll (easy)|Easy]] [[Treasure Trails]]. When examined, they all read; "Bob says: '<sentence>'". The sentence is always a rule or advice for players from [[Jagex]].

